My friend, collaborator, and fellow child of the islands  @braxtonolita and I are proud to present an instrumental holiday album of classics in the vintage Hawaiian-style featuring legendary lap steel player #bobbyingano accompanied by an incredible band. Honored to have Bobby bless us. This was a labor of love and the first of many projects like this. Aloha. Holidays In Hawaii drops 12.15 Pre-Save Now in Stories 🎄🌴 …

Recorded at: @coldcanyonclub  @islandsoundstudios 

@ctlgmusic #holidays #lapsteel #christmas #melekalikimaka
